        private void InitLanterns()
        {
            lock (lanternStrings)
            {
                lanternStrings.Clear();

                // Nếu bằng 0 thì không làm gì cả (Tắt)
                if (AppConfig.CheDoLongDen <= 0) return;

                int soDay = AppConfig.CheDoLongDen;
                float w = this.Width;

                for (int i = 0; i < soDay; i++)
                {
                    float xStart = (i * w / soDay);
                    float xEnd = ((i + 1) * w / soDay);

                    // Bù trừ mép màn hình
                    if (i == 0) xStart -= 30;
                    if (i == soDay - 1) xEnd += 30;

                    // Logic tính độ võng tự động dựa trên vị trí dây
                    // Dây càng ở giữa thì càng võng sâu
                    float viTriTuongDoi = (float)i / (soDay - 1);
                    if (soDay == 1) viTriTuongDoi = 0.5f; // Trường hợp chỉ có 1 dây

                    // Công thức tạo độ võng hình Parabol: sâu nhất ở giữa, nông ở hai bên
                    float sagValue = 60 + (float)(Math.Sin(viTriTuongDoi * Math.PI) * 50);

                    // Độ cao Y: dây ở giữa thấp hơn một chút
                    float yValue = 10 - (float)(Math.Sin(viTriTuongDoi * Math.PI) * 20);

                    // Ép kiểu float sang int/float tùy theo class LanternString của bạn
                    lanternStrings.Add(new LanternString(new PointF(xStart, yValue), new PointF(xEnd, yValue), (float)sagValue));
                }
            }
        }


        private Icon GetIconFromBase64(string base64)
        {
            try
            {
                byte[] buffer = Convert.FromBase64String(base64);
                using (System.IO.MemoryStream ms = new System.IO.MemoryStream(buffer))
                {
                    return new Icon(ms);
                }
            }
            catch
            {
                return SystemIcons.Application;
            }
        }

        private void LoadResources()
        {
            string baseDir = AppDomain.CurrentDomain.BaseDirectory;
            string pathTrees = Path.Combine(baseDir, "image", "tree");
            string pathPeach = Path.Combine(baseDir, "image", "PetalBlossom");
            string pathApricot = Path.Combine(baseDir, "image", "ApricotBlossom");

            try
            {
                if (File.Exists(Path.Combine(pathTrees, "CanhDao.png"))) imgBranchPeach = Image.FromFile(Path.Combine(pathTrees, "CanhDao.png"));
                if (File.Exists(Path.Combine(pathTrees, "CanhMai.png"))) imgBranchApricot = Image.FromFile(Path.Combine(pathTrees, "CanhMai.png"));
                LoadImgDir(pathPeach, peachImages);
                LoadImgDir(pathApricot, apricotImages);
            }
            catch { /* Bỏ qua nếu thiếu ảnh */ }
        }

        private void LoadImgDir(string path, List<Image> list)
        {
            if (!Directory.Exists(path)) return;
            foreach (string f in Directory.GetFiles(path, "*.png"))
            {
                using (Bitmap temp = new Bitmap(f)) list.Add(new Bitmap(temp, new Size(25, 25)));
            }
        }


        private void ResetPetals()
        {
            lock (petals) // Đảm bảo an toàn đa luồng nếu cần
            {
                petals.Clear();

                // 1. Kiểm tra nếu tắt cả 2 bên thì nghỉ luôn
                if (AppConfig.CayTrai == "Tắt" && AppConfig.CayPhai == "Tắt") return;

                for (int i = 0; i < AppConfig.SoLuongHoa; i++)
                {
                    bool isLeft;
                    // 2. Chia hoa: Nếu bật cả 2 thì chia đôi, nếu chỉ bật 1 bên thì dồn hết vào bên đó
                    if (AppConfig.CayTrai != "Tắt" && AppConfig.CayPhai != "Tắt")
                        isLeft = (i % 2 == 0);
                    else
                        isLeft = (AppConfig.CayTrai != "Tắt");

                    // 3. Lấy đúng loại ảnh dựa trên setting của bên đó
                    string type = isLeft ? AppConfig.CayTrai : AppConfig.CayPhai;
                    List<Image> imgSource = (type == "Mai") ? apricotImages : peachImages;

                    // 4. Tạo hoa (Chỉ tạo nếu danh sách ảnh có hình)
                    if (imgSource.Count > 0)
                    {
                        petals.Add(new Petal(this.Width, this.Height, rand, imgSource, isLeft));
                    }
                }
            }
        }





        private void ApplySettings()
        {
            // Cập nhật tốc độ vòng lặp
            animationTimer.Interval = 1000 / Math.Max(1, AppConfig.MucFPS);

            // QUAN TRỌNG: Làm mới toàn bộ cánh hoa
            ResetPetals();

            // Reset lại gió để áp dụng tốc độ/thời gian mới ngay lập tức
            windTicksRemaining = 0;

            // Cập nhật lại pháo (nếu cần)
            firecrackers.Clear();
            if (AppConfig.CayTrai != "Tắt") firecrackers.Add(new Firecracker(150, 200));
            if (AppConfig.CayPhai != "Tắt") firecrackers.Add(new Firecracker(this.Width - 150, 200));

            this.TopMost = AppConfig.AlwaysOnTop; // Nếu bạn đã thêm option này
            // Vẽ lại giao diện
            InitLanterns();
            //this.Invalidate();
        }

        private void UpdateLogic()
        {
            // --- QUẢN LÝ LOGIC GIÓ BIẾN THIÊN ---
            if (windTicksRemaining <= 0)
            {
                // 1. Tính toán thời gian thổi cho đợt gió mới (Giây * FPS)
                // Giả sử FPS của bạn là 40 (tương ứng Interval = 25ms)
                int fps = 40;
                int durationSec = rand.Next(AppConfig.WindDurationMinSec, AppConfig.WindDurationMaxSec + 1);
                windTicksRemaining = durationSec * fps;

                // 2. Tính toán lực gió mục tiêu (Random từ Min đến Max)
                targetWindForce = (float)(rand.NextDouble() * (AppConfig.WindSpeedMax - AppConfig.WindSpeedMin) + AppConfig.WindSpeedMin);

                // 3. Ngẫu nhiên hướng gió (50% thổi sang trái, 50% thổi sang phải)
                if (rand.Next(2) == 0) targetWindForce *= -1;
            }

            // Hiệu ứng làm mượt gió: Tiến dần từ lực gió cũ sang lực gió mới (Interpolation)
            // Giúp gió không bị thay đổi đột ngột gây giật cục
            currentWindForce += (targetWindForce - currentWindForce) * 0.05f;
            windTicksRemaining--;

            // Nếu gần hết đợt gió (ví dụ còn 1 giây cuối), cho gió lịm dần về 0
            if (windTicksRemaining < 40) targetWindForce = 0;

            // --- LOGIC LỐC XOÁY (Giữ nguyên hoặc chỉnh sửa nhẹ) ---
            tornadoTimer += 0.05f;
            if (!isTornado && tornadoTimer > 20)
            {
                isTornado = true;
                tornadoTimer = 0;
                tornadoCenter = new PointF(rand.Next(300, Width - 300), rand.Next(200, Height - 200));
            }
            if (isTornado && tornadoTimer > 6)
            {
                isTornado = false;
                tornadoTimer = 0;
            }

            // --- CẬP NHẬT ĐỐI TƯỢNG ---
            // Truyền currentWindForce vào thay vì windForce cũ
            foreach (var p in petals) p.Update(Width, Height, rand, currentWindForce, isTornado, tornadoCenter);

            foreach (var f in firecrackers) f.Update();

            // Sắp xếp chiều sâu 3D cho lốc xoáy
            petals = petals.OrderBy(p => p.ZOrder).ToList();


            // Thêm dòng này để đèn đung đưa
            foreach (var line in lanternStrings)
            {
                line.Update();
            }
        }






        protected override void OnPaint(PaintEventArgs e)
        {
            Graphics g = e.Graphics;
            g.SmoothingMode = SmoothingMode.None; // Tăng hiệu năng, giảm CPU

            // Ve Hoa
            foreach (var p in petals) p.Draw(g);





            // Vẽ Cây
            if (AppConfig.CayTrai != "Tắt")
            {
                var img = AppConfig.CayTrai == "Mai" ? imgBranchApricot : imgBranchPeach;
                if (img != null)
                {
                    var s = g.Save(); g.TranslateTransform(600, 0); g.ScaleTransform(-1, 1);
                    g.DrawImage(img, 0, 0, 600, 420); g.Restore(s);
                }
            }
            if (AppConfig.CayPhai != "Tắt")
            {
                var img = AppConfig.CayPhai == "Đào" ? imgBranchPeach : imgBranchApricot;
                if (img != null) g.DrawImage(img, Width - 600, 0, 600, 420);
            }

            // ve phao
            if (AppConfig.IsShowFirework) foreach (var f in firecrackers) f.Draw(g);

            // 2. Vẽ Dây Đèn Lồng & Lì Xì
            foreach (var line in lanternStrings)
            {
                line.Draw(g);
            }
        }

        private void InitTrayIcon(string base64Data)
        {

            NotifyIcon tray = new NotifyIcon();
            tray.Icon = GetIconFromBase64(base64Data); // Gán icon cho khay hệ thống
            tray.Visible = true;
            tray.Text = "Tết Việt Nam / Viet Nam Tet Holiday";

            ContextMenuStrip menu = new ContextMenuStrip();
            menu.Items.Add("Cài đặt", null, (s, e) => configWindow.Show());
            menu.Items.Add("Thoát", null, (s, e) => Application.Exit());
            menu.Items.Add("-"); // Dấu gạch ngang phân cách
            // 1. Thêm mục Giới thiệu (Mới)
            menu.Items.Add("Giới thiệu / About", null, (s, e) => ShowAboutDialog());
            tray.ContextMenuStrip = menu;


            // --- THÊM SỰ KIỆN DOUBLE CLICK TẠI ĐÂY ---
            tray.MouseDoubleClick += (s, e) =>
            {
                // Mở thẳng cửa sổ Cài đặt (Phổ biến nhất trên Windows)
                configWindow.Show();
                configWindow.Activate(); // Đưa cửa sổ lên trên cùng
            };



        }


