            grid.Dock = DockStyle.Fill;
            grid.ColumnCount = 2;
            grid.Padding = new Padding(15, 15, 15, 80);
            grid.AutoScroll = true;
            grid.ColumnStyles.Add(new ColumnStyle(SizeType.Percent, 50f));
            grid.ColumnStyles.Add(new ColumnStyle(SizeType.Percent, 50f));

            // --- CỘT 4: THIẾT LẬP CÂY VÀ PHÁO / TREE & FIRECRACKER SETTINGS ---
