            // --- CỘT 1: CÁC THÔNG SỐ CƠ BẢN / BASIC PARAMETERS ---
            AddItem(grid, "Số lượng hoa / Flower Count", 5, 500, AppConfig.SoLuongHoa, v => AppConfig.SoLuongHoa = v);
            AddItem(grid, "Tốc độ khung hình / Frame Rate (FPS)", 10, 60, AppConfig.MucFPS, v => AppConfig.MucFPS = v);

            // --- CỘT 2: THIẾT LẬP GIÓ / WIND SPEED ---
            AddItem(grid, "Tốc độ gió Min / Min Wind (x0.1)", 0, 50, (int)(AppConfig.WindSpeedMin * 10), v => AppConfig.WindSpeedMin = v / 10f);
            AddItem(grid, "Tốc độ gió Max / Max Wind (x0.1)", 0, 100, (int)(AppConfig.WindSpeedMax * 10), v => AppConfig.WindSpeedMax = v / 10f);

            // --- CỘT 3: THỜI GIAN GIÓ / WIND DURATION ---
            AddItem(grid, "Gió thổi tối thiểu / Min Duration (s)", 1, 20, AppConfig.WindDurationMinSec, v => AppConfig.WindDurationMinSec = v);
            AddItem(grid, "Gió thổi tối đa / Max Duration (s)", 1, 60, AppConfig.WindDurationMaxSec, v => AppConfig.WindDurationMaxSec = v);

            // --- LỒNG ĐÈN / LANTERN ---
            AddItem(grid, "Số lượng dây lồng đèn / Lantern Strings", 0, 5, AppConfig.CheDoLongDen, v => AppConfig.CheDoLongDen = v);

