        // Hàm bổ sung để chọn chữ (Mai/Đào/Bật/Tắt) chỉ lấy giá trị đầu tiên sau dấu / thay vì kéo thanh trượt

        private void AddComboItem(TableLayoutPanel parent, string name, string[] options, string current, Action<string> onChange)
        {
            Panel p = new Panel() { Width = 310, Height = 65, Margin = new Padding(5) };
            Label l = new Label() { Text = name, Top = 5, AutoSize = true, Font = new Font("Segoe UI", 8.5F, FontStyle.Bold) };

            ComboBox cb = new ComboBox()
            {
                DropDownStyle = ComboBoxStyle.DropDownList,
                Width = 280,
                Top = 25
            };

            // Nạp dữ liệu song ngữ
            cb.Items.AddRange(options);

            // LOGIC CHỌN ĐÚNG MỤC BAN ĐẦU:
            // Vì current là "Đào" nhưng options là "Đào / Cherry", ta cần tìm mục bắt đầu bằng current
            foreach (var item in options)
            {
                if (item.ToString().StartsWith(current))
                {
                    cb.SelectedItem = item;
                    break;
                }
            }

            cb.SelectedIndexChanged += (s, e) =>
            {
                if (cb.SelectedItem != null)
                {
                    string selectedFull = cb.SelectedItem.ToString();

                    // LOGIC TÁCH CHỮ: "Đào / Cherry" -> lấy "Đào"
                    // Nếu chuỗi có dấu '/', ta cắt lấy phần trước nó. Nếu không (như số lượng), lấy cả.
                    string logicValue = selectedFull.Contains("/")
                                        ? selectedFull.Split('/')[0].Trim()
                                        : selectedFull;

                    onChange(logicValue); // Lưu "Đào" hoặc "Bật" vào AppConfig
                    Console.WriteLine($"Đã đổi {name} thành logic: {logicValue}");
                }
            };

            p.Controls.Add(l);
            p.Controls.Add(cb);
            parent.Controls.Add(p);
        }

        private void AddCheckbox(TableLayoutPanel grid, string text, bool isChecked, Action<bool> onChanged)
        {
            CheckBox cb = new CheckBox();
            cb.Text = text;
            cb.Checked = isChecked;
            cb.AutoSize = true;
            cb.Margin = new Padding(3, 5, 3, 5);

            cb.CheckedChanged += delegate (object sender, EventArgs e)
            {
                onChanged(cb.Checked);
            };

            // CHỈ THÊM 1 LẦN: CheckBox sẽ nằm ở cột 1 của hàng hiện tại
            grid.Controls.Add(cb);

            // Đừng thêm Label rỗng nữa nếu bạn muốn ô bên cạnh để trống cho cái khác
        }




        private void AddItem(TableLayoutPanel parent, string name, int min, int max, int cur, Action<int> onScroll, string description = "")
        {
            Panel p = new Panel() { Width = 310, Height = 65, Margin = new Padding(5) };
            Label l = new Label()
            {
                Text = name + ": " + cur,
                AutoSize = true,
                Font = new Font("Segoe UI", 8.5F, FontStyle.Bold),
                ForeColor = Color.FromArgb(60, 60, 60)
            };

            TrackBar t = new TrackBar()
            {
                Minimum = min,
                Maximum = max,
                Value = Math.Max(min, Math.Min(max, cur)),
                Width = 290,
                Top = 25,
                TickStyle = TickStyle.None,
                Height = 30
            };

            t.Scroll += (s, e) =>
            {
                onScroll(t.Value);
                // Hiển thị giá trị thực tế (chia 10 nếu là tốc độ gió)
                if (name.Contains("Tốc độ gió"))
                    l.Text = name + ": " + (t.Value / 10f).ToString("0.0");
                else
                    l.Text = name + ": " + t.Value;
            };

            p.Controls.Add(l); p.Controls.Add(t);
            parent.Controls.Add(p);
        }

        private Button CreateBtn(string txt, int x, Color c, Action onClick)
        {
            Button b = new Button()
            {
                Text = txt,
                Location = new Point(x, 15),
                Size = new Size(270, 40),
                FlatStyle = FlatStyle.Flat,
                BackColor = c,
                ForeColor = Color.White,
                Font = new Font("Segoe UI", 9F, FontStyle.Bold),
                Cursor = Cursors.Hand
            };
            b.FlatAppearance.BorderSize = 0;
            b.Click += (s, e) => onClick();
            return b;
        }
    }















    // --- 4. CÁC ĐỐI TƯỢNG VẬT LÝ ---
    public class Petal
    {
        public float X, Y, Size, Speed, Rotation, RotSpeed, ZOrder;
        public float tornadoAngle;
        private Image _img;
        private bool _isStuck, _isInTornado, _isLeftSide;
        private float _time, _spiralY;

        public Petal(int w, int h, Random r, List<Image> imgs, bool leftSide)
        {
            if (imgs != null && imgs.Count > 0)
                _img = imgs[r.Next(imgs.Count)];

            _isLeftSide = leftSide;
            Reset(w, h, r, true);
        }

        public void Reset(int w, int h, Random r, bool anyY = false)
        {
            if (_isLeftSide) X = r.Next(0, 500);
            else X = r.Next(w - 500, w);

            Y = anyY ? r.Next(-h, 0) : r.Next(-100, -20);
            Size = r.Next(15, 25);
            Speed = (float)r.NextDouble() * 2 + 1;
            RotSpeed = r.Next(-5, 5);
            _time = (float)r.NextDouble() * 100;
            _isStuck = false;
            _isInTornado = false;
        }


        public void Update(int w, int h, Random r, float wind, bool tActive, PointF tCenter)
        {
            if (_isStuck) { if (tActive) _isStuck = false; return; }

            if (tActive && (Math.Sqrt(Math.Pow(X - tCenter.X, 2) + Math.Pow(Y - tCenter.Y, 2)) < 300 || _isInTornado))
            {
                if (!_isInTornado)
                {
                    _isInTornado = true;
                    tornadoAngle = (float)Math.Atan2(Y - tCenter.Y, X - tCenter.X);
                    _spiralY = Y - tCenter.Y;
                }
                tornadoAngle += 0.15f; _spiralY -= 3.5f;
                X = tCenter.X + (float)Math.Sin(tornadoAngle) * 120;
                Y = tCenter.Y + _spiralY + (float)Math.Cos(tornadoAngle) * 30;
                ZOrder = (float)Math.Cos(tornadoAngle); // Dùng để sắp xếp lớp vẽ
                if (_spiralY < -600) Reset(w, h, r);
            }
            else
            {
                _isInTornado = false; ZOrder = 0;
                Y += Speed; X += (float)Math.Sin(_time += 0.03f) + wind; Rotation += RotSpeed;
                if (Y > h - 50) _isStuck = true;
                if (Y > h || X < -100 || X > w + 100) Reset(w, h, r);
            }
        }

        public void Draw(Graphics g)
        {
            if (_img == null) return;
            var s = g.Save(); g.TranslateTransform(X, Y); g.RotateTransform(Rotation);
            g.DrawImage(_img, -Size / 2, -Size / 2, Size, Size); g.Restore(s);
        }
    }

    // --- 4. FIRECRACKER SYSTEM (PHÁO TẾT CHI TIẾT) ---
    public class Firecracker
    {
        // Cài đặt tràng pháo
        public int TotalPieces = 36;
        public float PieceWidth = 10f;
        public float PieceHeight = 35f;
        public float Spacing = 12f;
        public int ResetSeconds = 8;

        public PointF Location;
        public bool IsExploding = false;
        private List<FirePiece> pieces = new List<FirePiece>();
        private List<Confetti> confettiList = new List<Confetti>();
        private List<ExplosionParticle> particles = new List<ExplosionParticle>();
        private List<SmokeParticle> smoke = new List<SmokeParticle>();

        private int currentPieceIndex = 0;
        private Random rand = new Random();
        private bool isFinished = false;
        private int resetTimer = 0;

        public Firecracker(float x, float y)
        {
            Location = new PointF(x, y);
            InitializePieces();
        }


        public void InitializePieces()
        {
            pieces.Clear();
            confettiList.Clear();
            for (int i = 0; i < TotalPieces; i++)
            {
                bool isLeft = i % 2 == 0;
                float angle = isLeft ? -25f - rand.Next(0, 15) : 25f + rand.Next(0, 15);
                float xPos = isLeft ? Location.X - PieceWidth : Location.X;
                float yPos = Location.Y + (i / 2 * Spacing);

                pieces.Add(new FirePiece
                {
                    Rect = new RectangleF(xPos, yPos, PieceWidth, PieceHeight),
                    Angle = angle,
                    IsLeft = isLeft
                });
            }
            // QUAN TRỌNG: Bắt đầu từ index cuối cùng để nổ từ dưới lên
            currentPieceIndex = pieces.Count - 1;
            isFinished = false;
            IsExploding = false;
            resetTimer = 0;
        }



        public bool CheckClick(Point mouseLocation)
        {
            // Duyệt từ viên đầu tiên đến viên hiện tại (những viên chưa nổ)
            for (int i = 0; i <= currentPieceIndex; i++)
            {
                if (pieces[i].Rect.Contains(mouseLocation))
                {
                    return true;
                }
            }
            return false;
        }

        public void Explode() { if (!isFinished) IsExploding = true; }


        public void Update()
        {
            // Lấy tọa độ mép trên của Taskbar
            int taskbarTop = Screen.PrimaryScreen.WorkingArea.Height;

            if (IsExploding && currentPieceIndex >= 0) // Sửa điều kiện dừng
            {
                if (rand.Next(100) < 40)
                {
                    var p = pieces[currentPieceIndex];
                    float exX = p.Rect.X + (p.IsLeft ? 0 : p.Rect.Width);
                    float exY = p.Rect.Y + p.Rect.Height;

                    for (int i = 0; i < 15; i++) particles.Add(new ExplosionParticle(exX, exY, rand));
                    for (int i = 0; i < 3; i++) smoke.Add(new SmokeParticle(exX, exY, rand));
                    for (int i = 0; i < 12; i++) confettiList.Add(new Confetti(exX, exY, rand));

                    currentPieceIndex--; // GIẢM INDEX để nổ ngược lên trên
                }
            }
            else if (currentPieceIndex < 0) // Khi đã nổ hết sạch
            {
                IsExploding = false;
                isFinished = true;
            }

            if (isFinished && ++resetTimer >= (ResetSeconds * 1000 / 40)) InitializePieces();

            // Cập nhật hạt và mảnh xác pháo
            particles.ForEach(p => p.Update());
            smoke.ForEach(s => s.Update());
            confettiList.ForEach(c => c.Update(taskbarTop));

            particles.RemoveAll(p => p.Life <= 0);
            smoke.RemoveAll(s => s.Alpha <= 0);
            confettiList.RemoveAll(c => c.Alpha <= 0);
        }




        private void UpdateAllParticles()
        {
            int screenHeight = Screen.PrimaryScreen.Bounds.Height;
            particles.ForEach(p => p.Update());
            smoke.ForEach(s => s.Update());
            confettiList.ForEach(c => c.Update(screenHeight));

            particles.RemoveAll(p => p.Life <= 0);
            smoke.RemoveAll(s => s.Alpha <= 0);
            confettiList.RemoveAll(c => c.Alpha <= 0);
        }



        public void Draw(Graphics g)
        {
            // 1. Vẽ dây lõi (Sửa để ngắn dần từ dưới lên)
            if (!isFinished && currentPieceIndex >= 0)
            {
                // Tính toán vị trí kết thúc của dây dựa trên viên pháo còn lại cuối cùng
                float wireEndY = Location.Y + ((currentPieceIndex / 2) * Spacing);
                using (Pen wirePen = new Pen(Color.FromArgb(150, Color.Goldenrod), 2))
                {
                    g.DrawLine(wirePen, Location.X, Location.Y, Location.X, wireEndY);
                }
            }

            // 2. Vẽ viên pháo còn lại (Nổ từ dưới lên)
            // Duyệt từ 0 đến currentPieceIndex: Những viên ở trên (index nhỏ) sẽ biến mất sau cùng
            for (int i = 0; i <= currentPieceIndex; i++)
            {
                var p = pieces[i];
                var state = g.Save();

                // Di chuyển và xoay viên pháo
                g.TranslateTransform(p.Rect.X + (p.IsLeft ? p.Rect.Width : 0), p.Rect.Y);
                g.RotateTransform(p.Angle);

                var body = new RectangleF(p.IsLeft ? -p.Rect.Width : 0, 0, p.Rect.Width, p.Rect.Height);

                // Vẽ thân pháo đỏ
                g.FillRectangle(Brushes.Crimson, body);

                // Vẽ đuôi vàng (đầu nổ)
                g.FillRectangle(Brushes.Gold, body.X, body.Height - 5, body.Width, 5);

                // Vẽ viền để viên pháo rõ nét hơn
                g.DrawRectangle(Pens.DarkRed, body.X, body.Y, body.Width, body.Height);

                g.Restore(state);
            }

            // 3. Vẽ hiệu ứng xác pháo (Confetti), Khói (Smoke) và Tia lửa (Particles)
            // Vẽ xác pháo (Đã cập nhật logic rơi trên Taskbar trong hàm Update)
            foreach (var c in confettiList)
            {
                using (var b = new SolidBrush(Color.FromArgb(c.Alpha, Color.Crimson)))
                {
                    var s = g.Save();
                    g.TranslateTransform(c.X, c.Y);
                    g.RotateTransform(c.Rotation);
                    g.FillRectangle(b, -c.Size / 2, -c.Size / 4, c.Size, c.Size / 2);
                    g.Restore(s);
                }
            }

            // Vẽ khói mờ
            foreach (var s in smoke)
            {
                using (var b = new SolidBrush(Color.FromArgb(s.Alpha, 210, 210, 210)))
                {
                    g.FillEllipse(b, s.X, s.Y, s.Size, s.Size);
                }
            }

            // Vẽ tia lửa nổ
            foreach (var p in particles)
            {
                using (var b = new SolidBrush(Color.FromArgb(p.Life, 255, 220, 50)))
                {
                    g.FillEllipse(b, p.X, p.Y, p.Size, p.Size);
                }
            }
        }



    }

    // --- CÁC LỚP PHỤ TRỢ CHO PHÁO ---
    public class FirePiece
    {
        public RectangleF Rect;
        public float Angle;
        public bool IsLeft;
    }

    public class ExplosionParticle
    {
        public float X, Y, VX, VY;
        public int Life;
        public float Size;
        public ExplosionParticle(float x, float y, Random r)
        {
            X = x; Y = y;
            VX = (float)(r.NextDouble() * 8 - 4);
            VY = (float)(r.NextDouble() * 8 - 4);
            Life = r.Next(150, 255);
            Size = r.Next(2, 5);
        }
        public void Update() { X += VX; Y += VY; Life -= 15; VY += 0.2f; }
    }

    public class SmokeParticle
    {
        public float X, Y, VX, VY, Size;
        public int Alpha;
        public SmokeParticle(float x, float y, Random r)
        {
            X = x; Y = y;
            VX = (float)(r.NextDouble() * 2 - 1);
            VY = (float)(r.NextDouble() * -2);
            Size = r.Next(10, 20);
            Alpha = 180;
        }
        public void Update() { X += VX; Y += VY; Alpha -= 5; Size += 0.5f; }
    }


    public class Confetti
    {
        public float X, Y, VX, VY, Rotation, RotSpeed, Size;
        public int Alpha = 255;
        private bool isLanded = false;

        public Confetti(float x, float y, Random r)
        {
            X = x; Y = y;
            // Lực văng ngẫu nhiên khi pháo nổ
            VX = (float)(r.NextDouble() * 10 - 5);
            VY = (float)(r.NextDouble() * -8 - 2);
            Rotation = r.Next(0, 360);
            RotSpeed = r.Next(-15, 15);
            Size = r.Next(4, 8);
        }

        public void Update(int taskbarTop)
        {
            if (!isLanded)
            {
                X += VX; Y += VY;
                VY += 0.3f; // Trọng lực rơi xuống
                VX *= 0.96f; // Lực cản không khí
                Rotation += RotSpeed;

                // Kiểm tra va chạm với thanh Taskbar
                if (Y >= taskbarTop - 5)
                {
                    Y = taskbarTop - 5;
                    isLanded = true;
                    VX = 0; VY = 0; RotSpeed = 0;
                }
            }
            else
            {
                // Sau khi đậu trên sàn/taskbar, mờ dần rồi biến mất
                if (Alpha > 0) Alpha -= 2;
            }
        }
    }



    public class LanternString
    {
        public PointF StartPoint;
        public PointF EndPoint;
        public int LanternCount = 6;
        private float sag; // Độ võng của dây
        private float swingAngle = 0;

        // Thêm tham số sag (độ võng) vào Constructor
        public LanternString(PointF start, PointF end, float sagValue)
        {
            StartPoint = start;
            EndPoint = end;
            sag = sagValue;
        }

        public void Update()
        {
            // Mỗi dây đung đưa lệch pha một chút cho sinh động
            swingAngle = (float)Math.Sin(DateTime.Now.Ticks / 6000000.0 + StartPoint.Y) * 6;
        }


        public void Draw(Graphics g)
        {
            g.SmoothingMode = System.Drawing.Drawing2D.SmoothingMode.AntiAlias;

            // Điểm điều khiển
            PointF ctrl = new PointF((StartPoint.X + EndPoint.X) / 2, (StartPoint.Y + EndPoint.Y) / 2 + sag);

            // Vẽ dây chính
            using (Pen ropePen = new Pen(Color.FromArgb(70, 40, 10), 3))
            {
                g.DrawBezier(ropePen, StartPoint, ctrl, ctrl, EndPoint);
            }

            // Tăng LanternCount lên một chút (ví dụ 8-10) để treo được cả đèn và lì xì
            for (int i = 1; i < LanternCount; i++)
            {
                float t = (float)i / LanternCount;

                // Tính toán tọa độ x, y trên đường cong Bezier
                float x = (float)(Math.Pow(1 - t, 3) * StartPoint.X + 3 * Math.Pow(1 - t, 2) * t * ctrl.X + 3 * (1 - t) * Math.Pow(t, 2) * ctrl.X + Math.Pow(t, 3) * EndPoint.X);
                float y = (float)(Math.Pow(1 - t, 3) * StartPoint.Y + 3 * Math.Pow(1 - t, 2) * t * ctrl.Y + 3 * (1 - t) * Math.Pow(t, 2) * ctrl.Y + Math.Pow(t, 3) * EndPoint.Y);

                // LOGIC TREO XEN KẼ:
                if (i % 2 == 0)
                {
                    DrawFinalLantern(g, x, y); // Vị trí chẵn vẽ Đèn lồng
                }
                else
                {
                    DrawLuckyMoney(g, x, y);   // Vị trí lẻ vẽ Lì xì
                }
            }
        }



        private void DrawLuckyMoney(Graphics g, float x, float y)
        {
            var state = g.Save();
            g.TranslateTransform(x, y);

            // 1. Dây treo
            g.DrawLine(new Pen(Color.Gold, 1.5f), 0, 0, 0, 12);

            g.TranslateTransform(0, 12);
            g.RotateTransform(swingAngle * 1.5f);

            // 3. Thân bao lì xì
            RectangleF envelope = new RectangleF(-14, 0, 28, 42);
            g.FillRectangle(new SolidBrush(Color.Firebrick), envelope);
            g.DrawRectangle(new Pen(Color.Gold, 1f), envelope.X, envelope.Y, envelope.Width, envelope.Height);

            // 4. Chữ Lì Xì Việt Nam
            using (Font font = new Font("Arial", 7, FontStyle.Bold))
            {
                g.DrawString("Lì", font, Brushes.Gold, -6, 10);
                g.DrawString("Xì", font, Brushes.Gold, -6, 24);
            }

            g.Restore(state);
        }



        private void DrawFinalLantern(Graphics g, float x, float y)
        {
            var state = g.Save();
            g.TranslateTransform(x, y);

            // 1. Dây treo nhỏ
            g.DrawLine(new Pen(Color.Gold, 2), 0, 0, 0, 12);

            // 2. Đung đưa nắp và thân
            g.TranslateTransform(0, 12);
            g.RotateTransform(swingAngle);

            // 3. Nắp gỗ
            RectangleF topCap = new RectangleF(-18, 0, 36, 7);
            g.FillRectangle(new SolidBrush(Color.FromArgb(184, 134, 11)), topCap);
            g.DrawRectangle(Pens.Black, topCap.X, topCap.Y, topCap.Width, topCap.Height);

            // 4. Thân đèn lồng
            RectangleF bodyRect = new RectangleF(-25, 7, 50, 46);
            using (var path = new System.Drawing.Drawing2D.GraphicsPath())
            {
                path.AddEllipse(bodyRect);
                using (var brush = new System.Drawing.Drawing2D.PathGradientBrush(path))
                {
                    brush.CenterColor = Color.Red;
                    brush.SurroundColors = new Color[] { Color.DarkRed };
                    g.FillPath(brush, path);
                }
            }

            // Gân đèn
            g.DrawEllipse(new Pen(Color.FromArgb(100, Color.Gold), 1), -15, 7, 30, 46);

            // 5. Nắp dưới và Tua rua
            g.FillRectangle(new SolidBrush(Color.FromArgb(184, 134, 11)), -15, 53, 30, 5);
            for (int i = -1; i <= 1; i++)
            {
                g.DrawLine(new Pen(Color.Gold, 1.5f), i * 7, 58, i * 8 + (swingAngle * 0.4f), 80);
            }

            g.Restore(state);
        }
    }



    public class LuckyMoney
    {
        private float swingAngle = 0;

        public void Draw(Graphics g, float x, float y, float currentSwing)
        {
            var state = g.Save();
            g.TranslateTransform(x, y);

            // Dây treo nhỏ cho lì xì
            using (Pen p = new Pen(Color.Gold, 1.5f)) g.DrawLine(p, 0, 0, 0, 10);

            g.TranslateTransform(0, 10);
            g.RotateTransform(currentSwing);

            // Thân phong bao lì xì (Hình chữ nhật đứng)
            RectangleF envelope = new RectangleF(-12, 0, 24, 40);
            using (Brush b = new SolidBrush(Color.Firebrick))
            {
                g.FillRectangle(b, envelope);
            }
            g.DrawRectangle(Pens.Gold, envelope.X, envelope.Y, envelope.Width, envelope.Height);

            // Vẽ chữ "Phúc" hoặc họa tiết vàng trên lì xì
            using (Font f = new Font("Arial", 7, FontStyle.Bold))
            {
                g.DrawString("福", f, Brushes.Gold, -6, 12);
            }

            // Đuôi nắp lì xì
            g.DrawLine(Pens.Gold, -12, 10, 12, 10);

            g.Restore(state);
        }
    }



